import React, { FC } from 'react';
import { Field, FieldProps } from 'formik';

import style from './GenderRadioBtn.module.scss';

export enum Genders {
  Male = 1,
  Female = 2
}

export interface IGender {
  genders: Genders;
}

type TProps = IGender & FieldProps & { label?: string };

const GenderRadioBtn: FC<TProps> = ({ field, label }) => (
  <div>
    {label && <label className={style.customLabel}>{label}</label>}
    <div className={style.radioBtn}>
      <label className={style.genderType}>
        <Field type="radio" name="picked" value={Genders[1]} checked={field.value} />
        <span>Male</span>
      </label>
      <label className={style.genderType}>
        <Field type="radio" name="picked" value={Genders[2]} />
        <span>Female</span>
      </label>
    </div>
  </div>
);

export default GenderRadioBtn;
